prompt Created on יום חמישי 20 יוני 2024 by user
set feedback off
set define off
prompt Creating PROJECTS...
create table PROJECTS
(
  project_id   NUMBER not null,
  project_name VARCHAR2(100) not null,
  start_date   DATE not null,
  end_date     DATE not null
)
tablespace SYSTEM
  pctfree 10
  pctused 40
  initrans 1
  maxtrans 255
  storage
  (
    initial 64K
    next 1M
    minextents 1
    maxextents unlimited
  );
alter table PROJECTS
  add primary key (PROJECT_ID)
  using index 
  tablespace SYSTEM
  pctfree 10
  initrans 2
  maxtrans 255
  storage
  (
    initial 64K
    next 1M
    minextents 1
    maxextents unlimited
  );

