alter table SALARIES
  add constraint FK_SOLDIER foreign key (SOLDIER_ID_)
  references SOLDIERS (SOLDIER_ID_) on delete cascade;
alter table SALARIES
  add constraint CHK_AMOUNT_POSITIVE
  check (Amount_ > 0);

prompt Creating SOLDIERS...
create table SOLDIERS
(
  soldier_id_ NUMBER not null,
  first_name_ VARCHAR2(100),
  last_name_  VARCHAR2(100),
  birth_date_ DATE,
  rank_       VARCHAR2(100),
  unit_id_    NUMBER not null,
  salary_id_  NUMBER,
  role_id_    NUMBER not null
)
tablespace SYSTEM
  pctfree 10
  pctused 40
  initrans 1
  maxtrans 255
  storage
  (
    initial 64K
    next 1M
    minextents 1
    maxextents unlimited
  );
alter table SOLDIERS
  add primary key (SOLDIER_ID_)
  using index 
  tablespace SYSTEM
  pctfree 10
  initrans 2
  maxtrans 255
  storage
  (
    initial 64K
    next 1M
    minextents 1
    maxextents unlimited
  );
alter table SOLDIERS
  add foreign key (SALARY_ID_)
  references SALARIES (SALARY_ID_) on delete cascade;
alter table SOLDIERS
  add foreign key (UNIT_ID_)
  references UNITS (UNIT_ID_) on delete cascade;
alter table SOLDIERS
  add foreign key (ROLE_ID_)
